import React from "react";
import homeView from "../imgs/homeView.svg";
import Grid from "@material-ui/core/Grid";

export default function Welcome() {
  return (
    <Grid container>
      <Grid item>
        <h1>
          Create user stories and issues, plan sprints, and distribute tasks
          across your software team.
        </h1>
      </Grid>
      <Grid item>
        <img
          src={homeView}
          style={{
            width: "40em",
            // float: "right",
            // marginRight: "3em",
            // marginBottom: "3em",
          }}
          alt="Home page image"
        />
      </Grid>
    </Grid>
  );
}
